import React from 'react';
import '../assets/css/ToDos.css'

const List = (props) => {

  return (
    <section className="list">
      {
      props.toDos.map(toDo => {
        return(
        <div className="todo-card">
          <input type="checkbox" />
          <span>{toDo.task}</span>
          <button>Delete</button>
        </div>
      )})
      }
    </section>

  );
}

export default List;
